import { UserObserverInput, UserObserverService, UserObserverUseCase } from '../usecase'

class UserObserver implements UserObserverUseCase {
  private readonly service: UserObserverService

  constructor(service: UserObserverService) {
    this.service = service
  }

  userObserver(callback: UserObserverInput): void {
    return this.service.userObserver(callback)
  }
}

export { UserObserver }
